Veuillez ne pas publier ni diffuser d'informations qui viole les règles dans le jeu. Les contrevenants seront sévèrement traités.
Le contenu de violation inclut mais ne se limite pas à--
1. Informations personnelles de confidentialité: telles que le mot de passe de compte, le vrai nom, etc.
2. Incorporer des informations: telles que les achats de recharge, les téléchargements de liaison, etc.
3. Informations sociales: telles que les plates-formes sociales, les informations de contact, les liens de site Web, etc.
4. Contenu qui viole les lois et règlements nationaux:
 (1) violer les principes de base établis par la Constitution;
 (2) mettre fin à la sécurité nationale, aux fuites de secrets d'État, à la subvertir du pouvoir de l'État et à saper l'unité nationale;
 (3) Dommages à l'honneur national et aux intérêts;
 (4) Incitant la haine ethnique de la haine, la discrimination ethnique et la sape l'unité ethnique;
 (5) saper les politiques religieuses de l'État et promouvoir les cultes et les superstitions féodales;
 (6) répandant des rumeurs, une ordonnance sociale troublante et saper la stabilité sociale;
 (7) propager des obscénités, de la pornographie, du jeu, de la violence, de la terreur ou de l'instigation du crime;
 (8) insulter ou calmer les autres, enfreignant les droits légaux et les intérêts des autres;
 (9) Incitation d'assemblées illégales, d'associations, de processions, de démonstrations, de collecte de foules pour perturber l'ordre social;
 (10) agir au nom d'une organisation civile illégale;
 (11) Ceux qui ne se conforment pas aux «dispositions intérimaires sur le développement et la gestion des services d'information publique pour des outils de messagerie instantanée» et se conforment aux exigences «sept lignes finales» des lois et règlements, le système socialiste, les intérêts nationaux, le droit intérêts des citoyens, de l'ordre public, de la moralité sociale et de l'authenticité de l'information, etc.;
 (12) contenant d'autres contenus interdits par la législation et la réglementation administrative.
5. Autre contenu qui ne respecte pas les lois, les réglementations et les exigences de la plate-forme

#cfa7a0f sur la fonction de gestion de la musique #n
-In Jeux en ligne, seul l'hôte ou le serveur a le pouvoir d'exercer des opérations de gestion dans le lecteur de musique, telle que Pause, Song Song, Supprimer Song, etc.;

#cfa7a0f sur le contenu de la musique qui peut être joué sur demande #n
-Pour le moment, seules certaines des chansons autorisées par QQ Music sont prises en charge. À l'heure actuelle, nous nous efforçons de plus d'autorisations de la chanson à la demande, alors restez à l'écoute;

#cfa7a0f sur les restrictions à la demande en mode en ligne #n
-Music déjà dans la liste des joueurs à joueurs ne peut être ajouté à plusieurs reprises à la demande;
-Non-Non propriétaires ne peut ajouter que trois chansons à la liste d'attente en même temps. Après avoir atteint la limite supérieure, ils doivent attendre les chansons qui ont été commandées pour terminer ou être supprimées par le propriétaire avant de pouvoir les modifier;

#cfa7a0f sur le mode de lecture de la musique #n
-Queue Play: Joue dans l'ordre de la file d'attente de jeu et la chanson sera supprimée de la file d'attente après sa lecture.
-Loop Play: Jouez dans l'ordre de la file d'attente de jeu et la chanson restera dans la liste d'attente après la lecture.

#cfa7a0f À propos de la fonction de lecture complète #n
-Quand est allumé, tous les joueurs du jeu peuvent ajouter des chansons à la file d'attente de jeu.
-Quand fermé, seul l'hôte ou le serveur dans le jeu peut ajouter des chansons à la file d'attente de lecture.

1. Les aventuriers ont la possibilité de déclencher un pack-cadeau surprise lorsqu'ils complètent diverses actions de jeux;
2. Chaque pack-cadeau d'événement déclenché ne peut être acheté qu'une seule fois et que le pack-cadeau disparaît après la fin de l'achat;
3. Chaque pack-cadeau surprise a un compte à rebours séparé. Après le compte à rebours, le pack cadeau disparaît. Ne le manquez pas, chaque aventurier!

Le bouton gauche est sélectionné: lorsque l'élément parent change, la distance entre l'élément enfant et la bordure gauche de l'élément parent ne change pas;
-Le bouton à droite est sélectionné: lorsque l'élément parent change, la distance entre l'élément enfant et la bordure droite de l'élément parent ne change pas;
Le bouton -UPPER est sélectionné: lorsque l'élément parent change, la distance entre l'élément enfant et la bordure supérieure de l'élément parent ne change pas;
-Le bouton inférieur est sélectionné: lorsque l'élément parent change, la distance entre l'élément enfant et la bordure inférieure de l'élément parent ne change pas;
-Les boutons gauche et droit sont sélectionnés en même temps: lorsque l'élément parent change, la distance horizontale entre l'élément enfant et le point central de l'élément parent ne change pas;
Les boutons -UP et Down sont sélectionnés en même temps: lorsque l'élément parent change, la distance verticale entre l'élément enfant et le point central de l'élément parent ne change pas;
